function App() {
  const [backendData , setBackendData] = useState([])
  useEffect(() => {
    fetch("/api").then(response => response.json()
  ).then(
    data => {setBackendData(data)} )
  }, [])

  return (
    <div className='app'>
      <h1>hello</h1>

      {

        backendData.map(x=>(<h1>{x}</h1>))
      }
    </div>
  )
}

export default App
